function Emp(){


    const [user,setUser]=useState([]);

    const getData= ()=>{
        const result=fetch("http://localhost:8001/Data");
        const res=result.json();
        setUser(res);
        console.log(res)
    }
    useEffect(()=>{
        getData()
    },[])
    return(
        <>
            <h1>Employee Data</h1>
        </>
    )
}
export default Emp;
